// SearchContact.js
import React from 'react';
import './SearchContact.css';

export default function SearchContact({ filteredContacts, searchQuery, setSearchQuery }) {
  function searchUpdate(e) {
    setSearchQuery(e.target.value);
  }

  const filteredView = filteredContacts.filter(contact =>
    contact.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
    contact.age.toString().includes(searchQuery) ||
    contact.number.toString().includes(searchQuery)
  );

  return (
    <div>
      <nav>
        <input type='search' placeholder='Search' value={searchQuery} onChange={searchUpdate} />
      </nav>
      <div>
        {filteredView.map((contact, index) => (
          <div key={index}>
            <p>{contact.name}</p>
            <p>{contact.age}</p>
            <p>{contact.number}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
